import React from 'react';
import './Header.css';
import Button from "../button/Button";
import {Link} from "react-router-dom";

function Header({  icon, title , form}) {
    return (
        <header className="header-outer-container">
            <div className="header-inner-container">
                {/*<div className="header-content-container">*/}

           {/*<p> className="first-title"</p>*/}
            <img src={icon} alt={title} />
                <form className="form-xtra"
                      onSubmit={handleSubmit}>

                    {/*<Header icon={pic}/>*/}

                    <fieldset>
                        <legend><h1>Inloggen</h1></legend>


                        <label htmlFor="username">
                            <input id="username"
                                   value={username}
                                   onChange={(e) => setUsername(e.target.value)}
                                   name="username"
                                   placeholder="username"/>
                        </label>

                        <label htmlFor="pass">
                            <input id="pass"
                                   value={password}
                                   onChange={(e) => setPassword(e.target.value)}
                                   name="password"
                                   placeholder="password"/>
                        </label>

                        {error && <p className="error-msg">Inloggen mislukt !!
                            Gebruikersnaam of wachtwoord onjuist</p>}


                        <Button type="submit">
                            Inloggen
                        </Button>

                        <p>Nog geen account? <Link to="/Subscription">Registreer</Link> je dan eerst.</p>


                    </fieldset>


                </form>
            <h1>{title}</h1>

                {/*</div>*/}
            </div>

        </header>
    );
}

export default Header;
